# https://leetcode.com/problems/solving-questions-with-brainpower/

defmodule Solution do
  @spec most_points(questions :: [[integer]]) :: integer
  def most_points(questions) do
    seq_num_max = length(questions)

    walk_using_brainpower(Enum.reverse(questions), seq_num_max, Map.new())
  end

  def walk_using_brainpower([[points, brainpower] | rest], seq_num, cache) do
    max_points = max(points + Map.get(cache, seq_num + brainpower + 1, 0), Map.get(cache, seq_num + 1 , 0))

    cond do
      rest == [] -> max_points
      true ->
        walk_using_brainpower(rest, seq_num - 1, Map.put(cache, seq_num, max_points))
    end
  end
end

